import React from 'react';

const SearchPanel = () =>{
    const searchText = 'Text here to search';
    const searchStyle = {
         fontSize: '20px'
    };
    return <input 
           style = {searchStyle}
           placeholder={searchText}     />;
};

export default SearchPanel;
